    }

    allPaintings() {
        this.props.history.push('/add-single-painting');
    }

    render() {
        return (
            <div>
                <header>
                    <nav className="navbar navbar-expand-md navbar-dark bg-dark">
                        <div>
                            <a href="https://localhost:3000" className="navbar-brand">Painting Inventory Management</a>
                        </div>
                        <div className="collapse navbar-collapse">
                            <ul className="navbar-nav mr-auto">
                                <li className="nav-item active">
                                    <button className="nav-link" onClick={this.allPaintings}>All Paintings<span className="sr-only">(current)</span></button>
                                </li>
                            </ul>
                        </div>
                    </nav>
                </header>
            </div>
        )
    }
}
